def compositionk(text,k):
    kmers = []
    n = len(text)
    for i in range(n-k+1):
        samp = text[i:i+k]
        kmers.append(samp)
    kmers.sort()
    return kmers

text = ""
k = 100
p = compositionk(text,k)
f = open("final-ans2.txt","a")
for i in p:
    f.write(i)
    f.write("\n")
f.close()